お腹補整ショーツはこちら<br>
くびれメイクニッパーガードルはこちら<br>
ブラ(A70～C85)はこちら<br>
ブラ(D70～E85)はこちら<br><br>
<img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/exchange.gif" alt="返品・交換について" width="230" border="0"><br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/title.gif"><br><br>＜ブラ＞<br>■ 品質／ナイロン、ポリエステル、その他<br>● 3/4カップ<br>● ワイヤー入り<br>● サイドボーン有り(2本)<br>● 前・後ろホック3段3列<br>● パッド有り(取り外し可)<br>〔手洗い〕<br><br>＜お腹補正ショーツ＞<br>■ 品質／ナイロン、ポリウレタン、その他<br>〔洗濯機時ネット使用〕<br><br>＜くびれメイクニッパーガードル＞<br>■ 品質／ナイロン、ポリウレタン、その他<br>● 前ホック6段3列<br>〔洗濯機時ネット使用〕<br><br>※ 商品によって柄の出方が異なる場合があります。<br>【華やかに美胸を演出】<br>美しいだけじゃない、機能兼備したランジェリー。身につけるだけで美しいラインをつくる美力ランジェリーを味方につけたい。<br><br>魔法のように谷間をメイク。高く持ち上げて寄せて盛る！下着で理想のバストに近づく<br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/line.gif"><br><br><font color="#999999" size="1">色：ブラック/ピンク×グレー/ネイビー<br>サイズ：M/LL/L</font><br><br><!-- ページデザイン -->
<style type="text/css">

#pagebody {height:0;}
#pagebody table {
border-collapse:collapse;
}

body{
	font-family: "メイリオ", Meiryo, "游ゴシック", YuGothic, "ヒラギノ角ゴ ProN W3", "Hiragino Kaku Gothic ProN", sans-serif;
}

a:link { color:#2e2e2e; text-decoration:none; }
a:visited { color:#2e2e2e; }
a:active { color:#2e2e2e; }
a:hover { color:#2e2e2e; text-decoration:underline; }


/*販売実績*/
.results {
	color:#2e2e2e;
	font-size:20px;
	font-weight:bold;
	letter-spacing:0.5em;
	margin-bottom:50px;
}

.thanks{
	font-size:15px;
}

span.results_number{
	font-size:60px;
}


/*商品名周り*/
td.sdtext{
	font-size: 70%;
}	

span.catch_copy{
    line-height: 1.5em;
    display: block;
    font-size: 60%;
}

span.item_name {
    line-height: 1.5em;
    font-size: 75%;
}

strong, b {
	font-weight: normal;
}

span.inventory_choice_name {
    font-size: 80%;
}

td.inventory_choice_name {
    white-space: normal;
    padding-right: 2px;
    padding-left: 2px;
    padding-bottom: 2px;
    padding-top: 2px;
    margin: 0px;
}

span.inventory_desc {
display: block;
padding: 10px 0px;
}



/*カラーサイズ表*/
span.inventory_choice_name {
	font-size: 80%;
}

#rakutenLimitedId_aroundCart td.inventory {
	padding:3px!important;
}
.inventory font{
	font-size:10px;
	color: #999999;
}

span.item_desc{
    font-size: 80%;
    margin-top: 20px;
    display: block;
}

span.sale_desc img{
    width: 770px;
    display: block;
}


/*項目選択肢*/
span.choice {
	/*margin-top:20px;
	width:500px;
	padding:10px;
	border:1px solid #333;
	font-weight:bold;*/
	font-size: 12px;
}
span.choice + select {
	padding: 3px;
	border: 1px solid #ccc;
	font-weight: bold !important;
}
#rakutenLimitedId_aroundCart span.choice {
	display: block;
	margin-bottom: 5px;
}



/*お問い合わせボタン*/
font input {
	background:#fcfcfc 10px 5px 10px 0;
	background-image:none;
	margin-bottom:5px;
	padding:5px;
}

/*IE対応*/
*html font input {
	background:#fcfcfc no-repeat 9px 8px;
	margin-bottom:6px;
}

/*カゴ上送料説明バナー*/
span.unit {
	background:url(http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/pc_souryou.gif) no-repeat left top;
	text-indent:-9999; display: block; width: 210; height: 60; margin-top:5px; margin-bottom:0px;
	color:#FFFFFF;
}


</style>
<!--　カートデザイン end -->

＞ハイウエストショーツガードルはこちら<br>＞ブラはこちら<img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/exchange.gif" alt="返品・交換について" width="230" border="0"><br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/title.gif"><br><br>◎ サイズ豊富！！B70～F85(ブラ)<br>◎ 脇高(ブラ)<br>◎ ストレッチ(お腹押えショーツ)<br><br>＜ブラ＞<br>■ 品質／ナイロン、ポリウレタン、その他<br>● 3/4カップ<br>● ワイヤー入り<br>● 後ろホック2段3列<br>● パッド有り(取り外し可) <br><br>＜お腹押えショーツ＞<br>■ 品質／ポリエステル、ナイロン、その他<br><br>＜ハイウエストショーツガードル＞<br>■ 品質／ナイロン、ポリウレタン、その他<br><br>〔手洗い：ブラジャー〕<br>〔洗濯機ネット使用：お腹押えショーツ・ハイウエストショーツガードル〕マーメイドのようなロマ可愛デザインなのに、スタイルアップ機能が満載！ブラはバストを中心に寄せてくれる4段階切替など谷間メイクに一役。ショーツ＆ハイウエストショーツは、ぽっこりお腹を押さえてくれる優れもの。<br><br>◆背中のお肉は抑えつつ、胸が中心に寄るのでピタッと服で着やせ見え！(ブラ )<br><br>◆お腹とヒップをしっかり補整！裏打ちパワーネット仕様なので、気になるぽっこりお腹をしっかりサポート。(ハイウエストショーツガードル)まるでマーメイドのような憧れのシェルブラデザインが夏の気分を盛り上げる♪<br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/line.gif"><br><br><font color="#999999" size="1">サイズ：お腹押えショーツ/M/お腹押えショーツ/LL/お腹押えショーツ/L<br>色：ブラック/ピンク/サックス</font><br><br><!-- ページデザイン -->
